export const ADD_LIST= "ADD_LIST";

export const addlisthandler = (addDataForm) => (dispatch) => {
  console.log('dataaaa',addDataForm)
  dispatch({
    type: ADD_LIST,
    payload:addDataForm,
    successAddList:'success'
  });
};
